description:
An up-and-coming Hollywood star, a one-time finalist for the role of young Han Solo, the lead of "Baby Driver", a son of a Jewish photographer, is named... Ansel Elgort?












x = 0;
var as = new Array("Ansel Elgort", "See Troll Nag", "Longest Earl", "Green Atolls", "Eternal Slog", "Stolen Glare", "Lost General");
var bs = new Array('"Ansel Elgort" is a name of a real person, and not just jumbled up letters. Who knew?', "The story of a family of trolls led by a strong-headed, but very irritable grandmother...", "The story of an English nobleman who is pushed into politics, but wants to play professional basketball...", "The story of a man who moves to the South Pacific, but finds it not as peaceful as he thought...", "The story of a group of friends who graduate college, but waste away their 20s...", "The story of two people whose paths keep crossing, but they never realize it...", "The story of a soldier who leads an army, but in a war long lost...");
ab = document.getElementById("an");
bb = document.getElementById("bn");
function anagram() {
 x++;
 if (x >= as.length) x = 0;
 ab.innerHTML = as[x].toUpperCase();
 bb.innerHTML = bs[x];
}
